import React, {Component} from 'react';

class Footer extends Component {
    render() {
        return (
            <>
                <footer>
                    <h2>networks to contact me :</h2>
                    <div className="tg">
                        <img src="../imgs/" alt=""/>
                    </div>
                </footer>
            </>
        );
    }
}

export default Footer;
